import React, { useState, useEffect } from "react";
import { useLocation } from 'react-router-dom';

const BuyerDashboard = () => {
  const location = useLocation();
  const [userSession, setUserSession] = useState(null);
  const [productForm, setProductForm] = useState({
    productName: '',
    manufacturer: '',
    serialNumber: '',
    warrantyPeriod: 365
  });

  useEffect(() => {
    // Get user session from zkLogin (Member 2's part)
    const session = location.state || {
      walletAddress: "0xbcbbbbe9948f3dc59ba36278161eeabd7359ec8c1a1e396f40249660a89c6208", // Fallback for testing
      email: "test@example.com",
      role: "buyer",
      isAuthenticated: true
    };
    setUserSession(session);
  }, [location]);

  const mintWarrantyNFT = async (e) => {
    e.preventDefault();
    
    if (!userSession?.walletAddress) {
      alert("Please login first");
      return;
    }

    try {
      // This will call your smart contract
      const response = await fetch('/api/mint-warranty', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          ...productForm,
          recipientAddress: userSession.walletAddress,
          buyerEmail: userSession.email,
          packageId: "0x6d6728889ca99b00e2b98ee5e8491b2aded4d17d474af51d3420a5b5c2763b7f"
        })
      });

      if (response.ok) {
        alert("Warranty NFT created successfully!");
        setProductForm({ productName: '', manufacturer: '', serialNumber: '', warrantyPeriod: 365 });
      }
    } catch (error) {
      console.error("Error minting NFT:", error);
      alert("Failed to create warranty NFT");
    }
  };

  if (!userSession) {
    return <div>Loading...</div>;
  }

  return (
    <div className="buyer-dashboard">
      <h1>Buyer Dashboard</h1>
      
      {/* User Info from zkLogin */}
      <div className="user-info">
        <p><strong>Email:</strong> {userSession.email}</p>
        <p><strong>Wallet:</strong> {userSession.walletAddress?.slice(0, 10)}...</p>
      </div>

      {/* Warranty Registration Form */}
      <div className="warranty-form">
        <h2>Register Product Warranty</h2>
        <form onSubmit={mintWarrantyNFT}>
          <div>
            <label>Product Name:</label>
            <input
              type="text"
              value={productForm.productName}
              onChange={(e) => setProductForm({...productForm, productName: e.target.value})}
              required
            />
          </div>
          
          <div>
            <label>Manufacturer:</label>
            <input
              type="text"
              value={productForm.manufacturer}
              onChange={(e) => setProductForm({...productForm, manufacturer: e.target.value})}
              required
            />
          </div>
          
          <div>
            <label>Serial Number:</label>
            <input
              type="text"
              value={productForm.serialNumber}
              onChange={(e) => setProductForm({...productForm, serialNumber: e.target.value})}
              required
            />
          </div>
          
          <div>
            <label>Warranty Period (days):</label>
            <input
              type="number"
              value={productForm.warrantyPeriod}
              onChange={(e) => setProductForm({...productForm, warrantyPeriod: parseInt(e.target.value)})}
              required
            />
          </div>
          
          <button type="submit">Create Warranty NFT</button>
        </form>
      </div>
    </div>
  );
};

export default BuyerDashboard;
